        <div class='Wizard_DetailedWeather'>
            <Typography align='center'
                        variant='h4'>{location.city}, {location.countryCode}</Typography>
            <Typography variant='h4'>Current weather:</Typography>
            <Typography align='center'
                        variant='h5'>{Math.floor(weather.current.temp - 273.15, 1)} Â°C</Typography>
            <Typography align='center' variant='h6'>Wind {weather.current.wind_speed} meters per
                second</Typography>


        </div>
    );
}
